import React from "react"

function GrandChild() {
    return (
        <React.Fragment>
            <hr />
            <h3>I'm the Grandchild component</h3>
            <p>I'm also a part of the Grandchild component</p>
        </React.Fragment>
    )
}

export default GrandChild
